import React, { useState, useEffect } from 'react';
import { useNavigate } from "react-router-dom";
import { ajax_or_login } from "../../ajax";
import styled from '@emotion/styled';

function CreatePropertyPage() {
    return (
      <div>
        <Header />
        <CreateProperty />
        <Footer />
      </div>
    );
  }


  function Header() {
    return <div className="header"></div>;
  }


  function Footer() {
    return (
    <footer className="text-center text-lg-start bg-light text-muted absolute-bottom">
    <div
        className="text-center p-4"
        style={{ backgroundColor: 'rgba(0, 0, 0, 0.05)' }}
        >
        © 2023 Copyright
    </div>
    </footer>
);
}


function CreateProperty() {
  const navigate = useNavigate();
  const [error, setError] = useState("");
  // const [propertyData, setPropertyData] = useState([]);
//   {
//     avatar: '',
//     first_name: '',
//     last_name: '',
//     username:'',
//     email: '',
//     phone_number: '',
//     description: ''
//   }


//   useEffect(() => {
//     ajax_or_login("/accounts/profile/", {}, navigate)
//     .then(response => response.json())
//     .then(json => setProfileData(json))
// }, [navigate]);



function handle_submit(event) {
    let data = new FormData(event.target);

    ajax_or_login("/property/create/", {
        method: "POST",
        body: data,
    }, navigate)
    .then(request => request.json())
    .then(json => {
        let errorMessages = [];
        for (let key in json) {
            if (Array.isArray(json[key])) {
                errorMessages.push(`${key}: ${json[key].join(', ')}`);
            }else if (key === 'error') {
              errorMessages.push(json[key]);
          }
        }
        if (errorMessages.length > 0) {
            setError(errorMessages.join('; '));
        }else{
            navigate("/yourprofile/");
        }
    })
    .catch(error => {
        setError(error);
    });

    event.preventDefault();
}


const ImageContainer = styled.div`
  width: 140px;
  height: 140px;
  background-color: rgb(233, 236, 239);
  display: flex;
  justify-content: center;
  align-items: center;
